import React, { Fragment }from 'react';
import './App.css';
import { BrowserRouter,Routes, Route } from "react-router-dom";

function App() {
  return (<Fragment>
  <BrowserRouter>
    <Routes>
      <Route path='/' element={''}/>
      <Route path='/home' element={''}/>
      <Route path='/add-data' element={''}/>
      <h1>Hello</h1>
    </Routes>

  </BrowserRouter>
  </Fragment>
  );
}

export default App;
